INSERT INTO `ygdy_source_detail` VALUES ('http://www.ygdy8.com/html/gndy/dyzz/20170510/53958.html', '53958', 'gndy', 'dyzz', '2016年高分获奖剧情喜剧《杰出公民》BD中文字幕', '[https://public.lightpic.info/image/3B2E_5912C26F0.jpg, https://public.lightpic.info/image/9CC4_5913245D0.jpg]', '◎译  名 杰出公民/玩谢大作家(港) ◎片  名 El ciudadano ilustre / The Distinguished Citizen ◎年  代 2016 ◎产  地 阿根廷/西班牙 ◎类  别 剧情/喜剧 ◎语  言 西班牙语 ◎字  幕 中文 ◎上映日期 2016-09-04(威尼斯电影节)/2016-09-08(阿根廷)/2016-11-11(西班牙) ◎IMDb评分  7.5/10 from 2,117 users ◎豆瓣评分 8.5/10 from 9,667 users ◎文件格式 x264 + aac ◎视频尺寸 1280 x 720 ◎文件大小 1CD  ◎片  长 118分钟 ◎导  演 加斯顿·杜帕拉特 Gaston Duprat       马里亚诺·寇恩 Mariano Cohn ◎主  演 奥斯卡·马丁内兹 Oscar Martinez       达迪·布列瓦 Dady Brieva       安德丽娅·弗里杰里奥 Andrea Frigerio       诺拉·纳瓦斯 Nora Navas       曼努埃尔·维森特 Manuel Vicente       马塞洛·丹德烈亚 Marcelo D\'Andrea       贝伦·沙瓦纳 Belen Chavanne       古斯塔沃·加尔松 Gustavo Garzon       朱利安·拉基尔·泰拉里尼 Julian Larquier Tellarini       艾玛·里维拉 Emma Rivera       尼古拉斯·德·特蕾西 Nicolas de Tracy       丹尼尔·卡尔吉曼 Daniel Kargieman       亚历克西斯·洛佩兹·科斯塔 Alexis Lopez Costa       莱昂纳多·穆里亚 Leonardo Murija       佩德罗·罗斯 Pedro Roth  ◎简  介    小说家丹尼尔（奥斯卡·马丁内兹 Oscar Martinez 饰）从刚出道起事业就顺风顺水，如今更是获得了诺贝尔文学奖的殊荣，攀登上了职业的顶峰，然而这荣誉却并未带给他满足，恰恰相反，丹尼尔担心名声和财富会夺走他文学创作上的灵感与锋芒。   一晃眼五年过去，丹尼尔热度不减，邀约和奖项不断，可冷淡而又避世的他只教助手一一回绝。一封来自小镇萨拉斯的信吸引了丹尼尔的注意，萨拉斯是他阔别已久的故乡，如今邀请他踏上故土，接受“杰出公民”的奖项，在未告知媒体和朋友们的情况下，丹尼尔独自踏上了返乡的旅途，在那里，他再度见到了曾经的恋人艾琳（安德丽娅·弗里杰里奥 Andrea Frigerio 饰），如今的艾琳早已经嫁为人妻，而她的丈夫正是丹尼尔的旧友安东尼奥（达迪·布列瓦 Dady Brieva 饰）。  ◎获奖情况    第73届威尼斯电影节 (2016)   主竞赛单元 金狮奖 (提名)   沃尔皮杯 最佳男演员（威尼斯影帝） 奥斯卡·马丁内兹    第31届西班牙戈雅奖 (2017)   最佳伊比利亚美洲电影 马里亚诺·寇恩/加斯顿·杜帕拉特', 'El ciudadano ilustre / The Distinguished Citizen', '杰出公民/玩谢大作家(港)', '2016', '阿根廷/西班牙', '剧情/喜剧', null, null, null, '0', null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, '[ftp://ygdy8:ygdy8@yg42.dydytt.net:7017/[阳光电影www.ygdy8.com].杰出公民.BD.720p.中文字幕.mkv]', '20170510', '2', '2017-05-20 21:25:06');
