INSERT INTO `ygdy_source_detail` VALUES ('http://www.ygdy8.com/html/gndy/dyzz/20170514/53989.html', '53989', 'gndy', 'dyzz', '2016年高分传记剧情《摔跤吧！爸爸》BD中文字幕', '[https://public.lightpic.info/image/EFA3_591598070.jpg, https://public.lightpic.info/image/BA4E_591598100.jpg]', '◎译  名 摔跤吧！爸爸/我和我的冠军女儿(台)/摔跤吧！老爸/摔跤家族     ◎片  名 Dangal / Wrestling Competition     ◎年  代 2016     ◎产  地 印度     ◎类  别 剧情/传记/运动     ◎语  言 印地语     ◎字  幕 中文     ◎上映日期 2016-12-23(印度)/2017-05-05(中国)     ◎IMDb评分  8.8/10 from 45,905 users     ◎豆瓣评分 9.2/10 from 93,543 users     ◎文件格式 x264 + AAC     ◎视频尺寸 720 x 404     ◎文件大小 1CD     ◎片  长 169分钟(印度)/140分钟(中国大陆)     ◎导  演 涅提·蒂瓦里 Nitesh Tiwari     ◎主  演 阿米尔·汗 Aamir Khan           法缇玛·萨那·纱卡 Fatima Sana Shaikh           桑亚·玛荷塔 Sanya Malhotra           阿帕尔夏克提·库拉那 Aparshakti Khurana           沙克希·坦沃 Sakshi Tanwar           泽伊拉·沃西姆 Zaira Wasim           苏哈妮·巴特纳格尔 Suhani Bhatnagar           里特维克·萨霍里 Ritwik Sahore           吉里什·库卡尼 Girish Kulkarni          ◎简  介            马哈维亚·辛格·珀尕（阿米尔·汗 Aamir Khan 饰）曾是印度国家摔跤冠军，因生活所迫放弃摔跤。他希望让儿子可以帮他完成梦想——赢得世界级金牌。结果生了四个女儿本以为梦想就此破碎的辛格却意外发现女儿身上的惊人天赋，看到冠军希望的他决定不能让女儿的天赋浪费，像其他女孩一样只能洗衣做饭过一生 ，再三考虑之后，与妻子约定一年时间按照摔跤手的标准训练两个女儿：换掉裙子 、剪掉了长发，让她们练习摔跤，并赢得一个又一个冠军，最终赢来了成为榜样激励千千万万女性的机会……', 'Dangal / Wrestling Competition', '摔跤吧！爸爸/我和我的冠军女儿(台)/摔跤吧！老爸/摔跤家族', '2016', '印度', '剧情/传记/运动', null, null, null, '0', null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, '[ftp://ygdy8:ygdy8@y219.dydytt.net:8261/[阳光电影www.ygdy8.com].摔跤吧！爸爸.HD.720x404.中文字幕.mkv]', '20170514', '2', '2017-05-20 21:25:06');
INSERT INTO `ygdy_source_detail` VALUES ('http://www.ygdy8.com/html/gndy/dyzz/20170516/54006.html', '54006', 'gndy', 'dyzz', '2017年科幻动作《金刚狼3：殊死一战》HD中英双字幕', '[https://public.lightpic.info/image/1A2B_591ACCC60.jpg, https://public.lightpic.info/image/B173_591ACCC20.jpg, https://public.lightpic.info/image/28B4_591ACDCF0.jpg]', '◎译  名 金刚狼3：殊死一战/卢根(港)/罗根(台)/金刚狼3：罗根/金刚狼3：暮狼寻乡 ◎片  名 Logan ◎年  代 2017 ◎产  地 美国 ◎类  别 剧情/动作/科幻 ◎语  言 英语/西班牙语 ◎字  幕 中英双字幕 ◎IMDb评分  8.4/10 from 253,243 users ◎豆瓣评分 8.3/10 from 171,395 users ◎文件格式 HD-RMVB ◎视频尺寸 1280 x 720 ◎文件大小 1CD ◎片  长 137分钟 ◎导  演 詹姆斯·曼高德 James Mangold ◎主  演 休·杰克曼 Hugh Jackman       帕特里克·斯图尔特 Patrick Stewart       达芙妮·金 Dafne Keen       波伊德·霍布鲁克 Boyd Holbrook       斯戴芬·莫昌特 Stephen Merchant       伊丽莎白·罗德里格斯 Elizabeth Rodriguez       多丽丝·莫尔加多 Doris Morgado       理查德·E·格兰特 Richard E. Grant       玛丽·佩顿·斯图尔特 Mary Peyton Stewart       伊利斯·尼尔 Elise Neal       艾瑞琪·拉·塞拉 Eriq La Salle       劳伦·格罗斯 Lauren Gros       胡安·贾斯帕 Juan Gaspard       克日什托夫·索什斯基 Krzysztof Soszynski       萨博·班克森 Saber Bankson  ◎简  介    故事发生在2029年，彼时，X战警早已经解散，作为为数不多的仅存的变种人，金刚狼罗根（休·杰克曼 Hugh Jackman 饰）和卡利班（斯戴芬·莫昌特 Stephen Merchant 饰）照顾着年迈的X教授（帕特里克·斯图尔特 Patrick Stewart 饰），由于衰老，X教授已经丧失了对于自己超能力的控制，如果不依赖药物，他的超能力就会失控，在全球范围内制造无法挽回的灾难。不仅如此，金刚狼的自愈能力亦随着时间的流逝逐渐减弱，体能和力量都早已经大不如从前。   某日，一位陌生女子找到了金刚狼，将一个名为劳拉（达芙妮·基恩 Dafne Keen 饰）的女孩托付给他，嘱咐他将劳拉送往位于加拿大边境的“伊甸园”。让罗根没有想到的是，劳拉竟然是被植入了自己的基因而培养出的人造变种人，而在传说中的伊甸园里，有着一群和劳拉境遇相似的孩子。邪恶的唐纳德（波伊德·霍布鲁克 Boyd Holbrook 饰）紧紧的追踪着罗根一行人的踪迹，他的目标只有一个，就是将那群人造变种人彻底毁灭。  ◎获奖情况    第26届MTV电影奖 (2017)   MTV电影奖 年度电影(提名)   MTV电影奖 最佳表演(提名) 休·杰克曼   MTV电影奖 最佳银幕组合 休·杰克曼/达芙妮·基恩', 'Logan', '金刚狼3：殊死一战/卢根(港)/罗根(台)/金刚狼3：罗根/金刚狼3：暮狼寻乡', '2017', '美国', '剧情/动作/科幻', null, null, null, '0', null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, '[ftp://ygdy8:ygdy8@y219.dydytt.net:8263/[阳光电影www.ygdy8.com].金刚狼3：殊死一战.HD.720p.中英双字幕.rmvb]', '20170516', '2', '2017-05-20 21:25:06');
