INSERT INTO `ygdy_source_detail` VALUES ('http://www.ygdy8.com/html/gndy/jddy/20170518/54019.html', '54019', 'gndy', 'jddy', '2017年奇幻爱情《美女与野兽》HD国英双语中字', '[https://public.lightpic.info/image/C6D4_591C70E30.jpg, https://public.lightpic.info/image/28B2_591D946D0.jpg]', '◎译  名 美女与野兽 ◎片  名 Beauty and the Beast ◎年  代 2017 ◎产  地 美国 ◎类  别 爱情/奇幻/歌舞 ◎语  言 国语/英语 ◎字  幕 中文 ◎上映日期 2017-03-17(中国大陆)/2017-03-17(美国) ◎IMDb评分  7.7/10 from 99,581 users ◎豆瓣评分 7.4/10 from 113,500 users ◎文件格式 x264 + AAC ◎视频尺寸 1280 x 720 ◎文件大小 1CD ◎片  长 124分钟 ◎导  演 比尔·康顿 Bill Condon ◎主  演 艾玛·沃森 Emma Watson       丹·史蒂文斯 Dan Stevens       卢克·伊万斯 Luke Evans       凯文·克莱恩 Kevin Kline       乔什·盖德 Josh Gad       伊万·麦克格雷格 Ewan McGregor       伊恩·麦克莱恩 Ian McKellen       艾玛·汤普森 Emma Thompson       斯坦利·图齐 Stanley Tucci       古古·姆巴塔-劳 Gugu Mbatha-Raw       奥德拉·麦当娜 Audra McDonald       内森·麦克 Nathan Mack       哈蒂·莫拉汉 Hattie Morahan       迈克尔·吉普森 Michael Jibson       水野索诺娅 Sonoya Mizuno       亨利·加勒特 Henry Garrett       戴尔·布兰斯顿 Dale Branston  ◎简  介    贝儿（艾玛·沃森 Emma Watson 饰）和小镇上的其他女孩不同，是一个热爱阅读和幻想的姑娘，孔武有力英俊强壮的加斯顿（卢克·伊万斯 Luke Evans 饰）发誓要娶贝儿为妻，但贝儿却一眼看穿了他的自私和虚伪，拒不从命。某日，贝儿的父亲莫里斯（凯文·克莱恩 Kevin Kline 饰）迷路误打误撞之下来到了一座荒凉破败的城堡中，那里居住着样貌可怖半人半兽的野兽（丹·史蒂文斯 Dan Stevens 饰）。    因为偷摘了城堡里种植的玫瑰，莫里斯被野兽囚禁了起来，得知此消息的贝儿赶到城堡，要求和父亲作交换。就这样，贝儿开始了和野兽的同居生活。在会说话的茶壶太太（艾玛·汤普森 Emma Thompson 饰）、烛台卢米亚（伊万·麦克格雷格 Ewan McGregor 饰）和时钟葛士华（伊恩·麦克莱恩 Ian McKellen 饰）的照顾和帮助下，贝儿渐渐发现，野兽在丑陋的外表下，隐藏了一颗善良温柔的心。实际上，野兽的真实身份是一位王子，因受到了女巫的诅咒而沦落至此，而贝儿，是解除诅咒最后的，也是唯一的希望。  ◎获奖情况    第26届MTV电影奖 (2017)   MTV电影奖 年度电影   MTV电影奖 最佳表演 艾玛·沃森   MTV电影奖 最佳吻戏(提名) 艾玛·沃森/丹·史蒂文斯   MTV电影奖 最佳银幕组合(提名) 卢克·伊万斯/乔什·加德', 'Beauty and the Beast', '美女与野兽', '2017', '美国', '爱情/奇幻/歌舞', null, null, null, '0', null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, '[ftp://ygdy8:ygdy8@yg77.dydytt.net:7007/[阳光电影www.ygdy8.com].美女与野兽.HD.720p.国英双语中字.mkv]', '20170518', '2', '2017-05-20 21:25:07');
