INSERT INTO `ygdy_source_detail` VALUES ('http://www.ygdy8.com/html/gndy/jddy/20170519/54028.html', '54028', 'gndy', 'jddy', '2017年动画喜剧《宝贝老板》HD中英双字幕', '[https://public.lightpic.info/image/A133_591EED820.jpg, https://public.lightpic.info/image/C62F_591EEDA70.jpg]', '◎译  名 宝贝老板/娃娃老板/波士BB(港) ◎片  名 The Boss Baby ◎年  代 2017 ◎产  地 美国 ◎类  别 喜剧/动画 ◎语  言 英语 ◎字  幕 中英双字幕 ◎上映日期 2017-03-12(迈阿密电影节)/2017-03-31(美国) ◎IMDb评分  6.5/10 from 16,471 users ◎豆瓣评分 7.6/10 from 1,496 users ◎文件格式 HD-RMVB ◎视频尺寸 1280 x 720 ◎文件大小 1CD ◎片  长 97分钟 ◎导  演 汤姆·麦格拉思 Tom McGrath ◎主  演 亚历克·鲍德温 Alec Baldwin       史蒂夫·布西密 Steve Buscemi       吉米·坎摩尔 Jimmy Kimmel       丽莎·库卓 Lisa Kudrow       托比·马奎尔 Tobey Maguire       迈尔斯·克里斯托弗·巴克什 Miles Christopher Bakshi       詹姆斯·麦格拉思 James McGrath       康拉德·弗农 Conrad Vernon       薇薇安·叶 ViviAnn Yee       埃里克·贝尔·Jr. Eric Bell Jr.       大卫·索伦 David Soren       伊迪·米尔曼 Edie Mirman       詹姆斯·雷恩 James Ryan       沃尔特·道恩 Walt Dohrn       朱尔斯·温特 Jules Winter  ◎简  介    现在的孩子都是家里的小皇帝、小公主，生了孩子后一家人的生活重心彻底改变，大人们都要围着孩子转。有感于此，梦工厂导演Tom McGrath构思了这部《娃娃老板》，不过他脑洞更大，在片中，这些咿咿呀呀、满地乱爬的小娃娃一个个成为心机很深的阴谋家！    亚历克·鲍德温（Alec Baldwin）在《娃娃老板》里为主角婴儿Timothy Templeton配音，当家中迎来弟弟后，他一下子就失宠了，爸爸妈妈的心思全都在弟弟身上，这让他很不爽。    不过更加让他震惊的是，看似人畜无害的弟弟原来是一家叫做Puppy公司的经理，这家公司正密谋颠覆世界。Timothy必须和“弟弟”联起手来，才能拯救他们的父母、阻止这一阴谋。', 'The Boss Baby', '宝贝老板/娃娃老板/波士BB(港)', '2017', '美国', '喜剧/动画', null, null, null, '0', null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, '[ftp://ygdy8:ygdy8@yg42.dydytt.net:8022/[阳光电影www.ygdy8.com].宝贝老板.HD.720p.中英双字幕.rmvb]', '20170519', '2', '2017-05-20 21:25:07');
